/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `update_complaint_on_resolved`
AFTER UPDATE ON `complaint_status`
FOR EACH ROW
BEGIN
    -- Check if the complaint status is changed to "Resolved"
    IF NEW.Complaint_Status = 'Resolved' THEN
        -- Update the `Date_Resolved` in the `complaint` table
        UPDATE `complaint`
        SET `Date_Resolved` = NOW()
        WHERE `Complaint_ID` = NEW.Complaint_ID;
    END IF;
END */;;
